  wd:Q1317 wdt:P20 ?placeOfDeath .
  OPTIONAL {
    ?placeOfDeath rdfs:label ?placeOfDeathLabel FILTER ( LANG( ?placeOfDeathLabel ) = "en" )
  }
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?coordinate ?country ?countryLabel ?adminEntity ?adminEntityLabel WHERE {
  wd:Q5680 wdt:P625 ?coordinate .
  OPTIONAL {
    wd:Q5680 wdt:P17 ?country .
  }
  OPTIONAL {
    ?country rdfs:label ?countryLabel FILTER ( LANG( ?countryLabel ) = "en" )
  }
  OPTIONAL {
    wd:Q5680 wdt:P131 ?adminEntity .
  }
  OPTIONAL {
    ?adminEntity rdfs:label ?adminEntityLabel FILTER ( LANG( ?adminEntityLabel ) = "en" )
  }
}

PREFIX p: <http://www.wikidata.org/prop/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
SELECT ?actor ?actorLabel WHERE {
  wd:Q107940 p:P161 ?statement .
  ?statement ps:P161 ?actor ; pq:P453 wd:Q16311 .
  OPTIONAL {
    ?actor rdfs:label ?actorLabel FILTER ( LANG( ?actorLabel ) = "en" )
  }
}
LIMIT 10

