PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?language ?languageLabel ?status WHERE {
  {
    wd:Q408 wdt:P37 ?language .
    BIND( "official" AS ?status )
  } UNION {
    wd:Q408 wdt:P2936 ?language .
    FILTER NOT EXISTS {
      wd:Q408 wdt:P37 ?language
    }
    BIND( "widely used" AS ?status )
  }
  FILTER ( isIRI( ?language ) ) OPTIONAL {
    ?language rdfs:label ?languageLabel FILTER ( LANG( ?languageLabel ) = "en" )
  }
}
ORDER BY ?status ?languageLabel

